import React from 'react'

const ImageCard = ({imageData}) => {
    const { id, farm, server, secret } = imageData;
    const url = `https://farm${farm}.staticflickr.com/${server}/${id}_${secret}.jpg`;
    return (
        <div>
           <h4>{url}</h4> 
        </div>
    )
}

export default ImageCard
